import React, { useState, ChangeEvent } from 'react';
import {
  Container,
  Grid,
  Card,
  CardContent,
  CardMedia,
  CardActions,
  Typography,
  Button,
  TextField,
  InputAdornment,
  Box,
  Chip,
  Stack,
  Theme,
} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import { styled } from '@mui/material/styles';

interface Tour {
  id: number;
  title: string;
  description: string;
  image: {
    url: string;
    alt: string;
  };
  duration: string;
  price: string;
  tags: string[];
}

const StyledCard = styled(Card)(({ theme }: { theme: Theme }) => ({
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  transition: 'transform 0.3s ease-in-out',
  '&:hover': {
    transform: 'translateY(-5px)',
    boxShadow: theme.shadows[8],
  },
}));

const tours: Tour[] = [
  {
    id: 1,
    title: 'Valletta City Tour',
    description: 'Explore the historic capital of Malta with our expert guides. Visit St. John\'s Co-Cathedral, the Grand Master\'s Palace, and more.',
    image: {
      url: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
      alt: 'Valletta City View'
    },
    duration: '4 hours',
    price: '€45',
    tags: ['History', 'Culture', 'Walking'],
  },
  {
    id: 2,
    title: 'Mdina & Rabat',
    description: 'Discover the ancient walled city of Mdina and its surroundings. Experience the medieval atmosphere and stunning views.',
    image: {
      url: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
      alt: 'Mdina City View'
    },
    duration: '3 hours',
    price: '€35',
    tags: ['History', 'Architecture', 'Walking'],
  },
  {
    id: 3,
    title: 'Blue Lagoon Cruise',
    description: 'Experience the crystal-clear waters of Comino and the famous Blue Lagoon. Perfect for swimming and snorkeling.',
    image: {
      url: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
      alt: 'Blue Lagoon View'
    },
    duration: '6 hours',
    price: '€55',
    tags: ['Boat', 'Swimming', 'Nature'],
  },
  {
    id: 4,
    title: 'Gozo Island Tour',
    description: 'Visit the sister island of Malta, known for its rural charm, historical sites, and beautiful landscapes.',
    image: {
      url: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
      alt: 'Gozo Island View'
    },
    duration: '8 hours',
    price: '€65',
    tags: ['History', 'Nature', 'Full Day'],
  },
];

const Tours: React.FC = () => {
  const [searchTerm, setSearchTerm] = useState<string>('');
  const [selectedTags, setSelectedTags] = useState<string[]>([]);

  const allTags = [...new Set(tours.flatMap(tour => tour.tags))];

  const filteredTours = tours.filter(tour => {
    const matchesSearch = tour.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         tour.description.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesTags = selectedTags.length === 0 || 
                       selectedTags.some(tag => tour.tags.includes(tag));
    return matchesSearch && matchesTags;
  });

  const handleTagClick = (tag: string) => {
    setSelectedTags(prev => 
      prev.includes(tag) 
        ? prev.filter(t => t !== tag)
        : [...prev, tag]
    );
  };

  const handleSearchChange = (e: ChangeEvent<HTMLInputElement>) => {
    setSearchTerm(e.target.value);
  };

  return (
    <Container sx={{ py: 8 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Available Tours
      </Typography>
      
      <Box sx={{ mb: 4 }}>
        <TextField
          fullWidth
          variant="outlined"
          placeholder="Search tours..."
          value={searchTerm}
          onChange={handleSearchChange}
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <SearchIcon />
              </InputAdornment>
            ),
          }}
          sx={{ mb: 2 }}
        />
        
        <Stack direction="row" spacing={1} flexWrap="wrap" useFlexGap>
          {allTags.map((tag) => (
            <Chip
              key={tag}
              label={tag}
              onClick={() => handleTagClick(tag)}
              color={selectedTags.includes(tag) ? 'primary' : 'default'}
              sx={{ mb: 1 }}
            />
          ))}
        </Stack>
      </Box>

      <Grid container spacing={4}>
        {filteredTours.map((tour) => (
          <Grid item key={tour.id} xs={12} sm={6} md={4}>
            <StyledCard>
              <CardMedia
                component="img"
                height="200"
                image={tour.image.url}
                alt={tour.image.alt}
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="h2">
                  {tour.title}
                </Typography>
                <Typography variant="body2" color="text.secondary" paragraph>
                  {tour.description}
                </Typography>
                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                  <Typography variant="body2" color="text.secondary">
                    Duration: {tour.duration}
                  </Typography>
                  <Typography variant="h6" color="primary">
                    {tour.price}
                  </Typography>
                </Box>
                <Stack direction="row" spacing={1} flexWrap="wrap" useFlexGap>
                  {tour.tags.map((tag) => (
                    <Chip
                      key={tag}
                      label={tag}
                      size="small"
                      variant="outlined"
                    />
                  ))}
                </Stack>
              </CardContent>
              <CardActions>
                <Button size="small" color="primary" href="/book">
                  Book Now
                </Button>
                <Button size="small" color="primary">
                  Learn More
                </Button>
              </CardActions>
            </StyledCard>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Tours;
